import React, {useEffect} from 'react'
import M from 'materialize-css'
function ContactPage(){
    useEffect(()=>{
        window.M.u()
    },)
return(
    <>
        <div className="parallax-container">
            <div class="parallax"><img src="/images/contact1.jpeg"/></div>
        </div>
    </>
)
}

export default ContactPage
